-- Habilitar extensiones necesarias
CREATE EXTENSION IF NOT EXISTS postgis;
CREATE EXTENSION IF NOT EXISTS pgrouting;
SET CLIENT_ENCODING TO UTF8;
SET STANDARD_CONFORMING_STRINGS TO ON;
BEGIN;
CREATE TABLE "public"."points" (gid serial,
"osm_id" float8,
"timestamp" varchar(20),
"name" varchar(48),
"type" varchar(16));
ALTER TABLE "public"."points" ADD PRIMARY KEY (gid);
SELECT AddGeometryColumn('public','points','geom','4326','POINT',2);
CREATE INDEX ON "public"."points" USING GIST ("geom");
COMMIT;
ANALYZE "public"."points";
